parts:
{
  "name": "UBX-LOG-RETRIEVESTRING",
  "class_id": "0x21",
  "message_id": "0x0d",
  "description": "Byte string log entry",
  "message_type": "output",
  "payload_length": {
    "variable": {
      "base": 16,
      "formula": "16 + byteCount"
    }
  },
  "supported_versions": [
    "15",
    "15.01",
    "16",
    "17",
    "18",
    "19",
    "19.1",
    "19.2",
    "20",
    "20.01",
    "20.1",
    "20.2",
    "20.3",
    "22",
    "22.01",
    "23",
    "23.01"
  ],
  "fields": [
    {
      "byte_offset": 0,
      "name": "entryIndex",
      "data_type": "U4",
      "description": "The index of this log entry"
    },
    {
      "byte_offset": 4,
      "name": "version",
      "data_type": "U1",
      "description": "Message version (0x00 for this version)",
      "fixed_value": 0
    },
    {
      "byte_offset": 5,
      "name": "reserved1",
      "data_type": "U1",
      "description": "Reserved",
      "reserved": true
    },
    {
      "byte_offset": 6,
      "name": "year",
      "data_type": "U2",
      "description": "Year (1-65635) of UTC time. Will be zero if time not known"
    },
    {
      "byte_offset": 8,
      "name": "month",
      "data_type": "U1",
      "description": "Month (1-12) of UTC time"
    },
    {
      "byte_offset": 9,
      "name": "day",
      "data_type": "U1",
      "description": "Day (1-31) of UTC time"
    },
    {
      "byte_offset": 10,
      "name": "hour",
      "data_type": "U1",
      "description": "Hour (0-23) of UTC time"
    },
    {
      "byte_offset": 11,
      "name": "minute",
      "data_type": "U1",
      "description": "Minute (0-59) of UTC time"
    },
    {
      "byte_offset": 12,
      "name": "second",
      "data_type": "U1",
      "description": "Second (0-60) of UTC time"
    },
    {
      "byte_offset": 13,
      "name": "reserved2",
      "data_type": "U1",
      "description": "Reserved",
      "reserved": true
    },
    {
      "byte_offset": 14,
      "name": "byteCount",
      "data_type": "U2",
      "description": "Size of string in bytes"
    },
    {
      "byte_offset": 16,
      "name": "bytes",
      "data_type": {
        "array_of": "U1",
        "count_field": "byteCount"
      },
      "description": "The bytes of the string"
    }
  ]
}
